import React, { useState, useRef } from 'react';
import { Container, Typography, Paper, Button, Box, TextField } from '@mui/material';
import axios from 'axios';
import { API_URL } from '../../config';

const QRScanner = () => {
  const [scannedOrders, setScannedOrders] = useState({});
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [orderId, setOrderId] = useState('');
  const fileInputRef = useRef();

  const handleFileInput = async (event) => {
    const file = event.target.files[0];
    if (!file) return;

    try {
      setLoading(true);
      // TODO: Implement actual QR code scanning
      // For now, we'll use manual order ID input
      setResult({
        status: 'error',
        message: 'QR scanning is not implemented yet. Please use the Order ID input field below.'
      });
    } catch (error) {
      console.error('Error reading QR code:', error);
      setResult({
        status: 'error',
        message: 'Failed to read QR code. Please try again or enter the Order ID manually.'
      });
    } finally {
      setLoading(false);
      // Reset file input
      event.target.value = '';
    }
  };

  const handleOrderId = async (orderId) => {
    if (!orderId || orderId.trim() === '') {
      setResult({
        status: 'error',
        message: 'Please enter a valid Order ID'
      });
      return;
    }

    try {
      setLoading(true);
      // Check if order was already scanned
      if (scannedOrders[orderId]) {
        setResult({
          orderId,
          status: 'already_served',
          message: 'This order has already been served!'
        });
        return;
      }

      // Fetch order details from backend
      const response = await axios.get(`${API_URL}/orders/${orderId}`);
      const order = response.data;

      // Mark order as served using PATCH request
      await axios.patch(`${API_URL}/orders/${orderId}`, { status: 'completed' });
      setScannedOrders({ ...scannedOrders, [orderId]: true });

      setResult({
        orderId,
        status: 'new_order',
        message: 'Order found and marked as completed!',
        details: {
          orderId: order._id,
          items: order.items.map(item => ({
            name: item.productId?.name || 'Unknown Product',
            quantity: item.quantity,
            price: item.price
          })),
          timestamp: new Date(order.createdAt).toLocaleString(),
          total: order.total
        }
      });
    } catch (error) {
      console.error('Error processing order:', error);
      let errorMessage = 'Failed to process order';

      if (error.response?.status === 404) {
        errorMessage = 'Order not found. Please check the Order ID and try again.';
      } else if (error.response?.data?.message) {
        errorMessage = error.response.data.message;
      }

      setResult({
        status: 'error',
        message: errorMessage
      });
    } finally {
      setLoading(false);
    }
  };

  const handleManualSubmit = (e) => {
    e.preventDefault();
    handleOrderId(orderId);
  };

  return (
    <Container>
      <Typography variant="h4" style={{ margin: '20px 0' }}>
        Order Processing
      </Typography>

      <Paper style={{ padding: '20px', marginBottom: '20px' }}>
        <Box textAlign="center">
          <Typography variant="h6" gutterBottom>
            Option 1: Scan QR Code
          </Typography>
          <input
            type="file"
            accept="image/*"
            onChange={handleFileInput}
            ref={fileInputRef}
            style={{ display: 'none' }}
          />
          <Button
            variant="contained"
            color="primary"
            onClick={() => fileInputRef.current.click()}
            disabled={loading}
          >
            {loading ? 'Processing...' : 'Upload QR Code Image'}
          </Button>

          <Box mt={4}>
            <Typography variant="h6" gutterBottom>
              Option 2: Enter Order ID
            </Typography>
            <form onSubmit={handleManualSubmit}>
              <TextField
                fullWidth
                label="Order ID"
                variant="outlined"
                value={orderId}
                onChange={(e) => setOrderId(e.target.value)}
                style={{ marginBottom: '10px' }}
                disabled={loading}
              />
              <Button
                type="submit"
                variant="contained"
                color="primary"
                disabled={loading || !orderId.trim()}
              >
                {loading ? 'Processing...' : 'Process Order'}
              </Button>
            </form>
          </Box>
        </Box>
      </Paper>

      {result && (
        <Paper style={{ 
          padding: '20px', 
          backgroundColor: 
            result.status === 'already_served' ? '#ffebee' : 
            result.status === 'error' ? '#fff3e0' : '#e8f5e9' 
        }}>
          <Typography variant="h6" gutterBottom>
            {result.message}
          </Typography>

          {result.details && (
            <>
              <Typography variant="subtitle1" gutterBottom>
                Order ID: {result.details.orderId}
              </Typography>
              <Typography variant="subtitle1" gutterBottom>
                Time: {result.details.timestamp}
              </Typography>
              <Typography variant="subtitle1">Items:</Typography>
              {result.details.items.map((item, index) => (
                <Typography key={index}>
                  - {item.name} x {item.quantity} - ${(item.price * item.quantity).toFixed(2)}
                </Typography>
              ))}
              <Typography variant="h6" style={{ marginTop: '10px' }}>
                Total: ${result.details.total.toFixed(2)}
              </Typography>
            </>
          )}
        </Paper>
      )}

      {result && (
        <Button
          variant="contained"
          color="primary"
          onClick={() => {
            setResult(null);
            setOrderId('');
          }}
          style={{ marginTop: '20px' }}
        >
          Clear Result
        </Button>
      )}
    </Container>
  );
};

export default QRScanner;
